import React from 'react';

const ExploreMaterial = () => {
    return (
        <div>
            <h1>Explore Material</h1>
            <p>Welcome to the Explore Material section. Here you can find various resources and materials to help you with your studies.</p>
        </div>
    );
};

export default ExploreMaterial;
